import React from 'react'
import { useSelector } from 'react-redux';


const MemberMovieWatched = ({id}) => {
    const subscriptions = useSelector(state => state.SubscriptionsReducer.subscriptions);
    const movies = useSelector(state => state.MoviesReducer.movies);
    const subscriptionsMember = subscriptions.filter((sub)=> sub.memberId === id)
    const moviesMember =subscriptionsMember.filter((subMem)=> subMem.movieId )

    console.log(subscriptionsMember)
    console.log(movies)
    console.log(moviesMember)
    // console.log(moviesMember)
    const moviesRep = () => {
        moviesMember.map((movMem)=> {
            return (
                <li key={movMem._id}>
                    {movMem.date}
                </li>
            )
        })
    }
  return (
    <div>
        <h4>Movies Watched</h4>
        <button>Subscribe to new movie</button>
        <ul>
            {moviesRep}
        </ul>
    </div>
  )
}

export default MemberMovieWatched
